INSERT INTO `pages` (`id`, `title`, `slug`, `content`, `on_menu`, `featured_image`, `added`, `updated`)
VALUES
	(1,'About','about','<p><p xss=removed>Top10.com offers hundreds of Top10 shortlists to help you make informed decisions and easily compare your purchasing options online. Trusted by millions, our shortlists are enriched with editorial reviews and deep-dive, informational articles - all with the goal of turning your online purchasing decision into a breeze.</p><p xss=removed>Since 2009 we’ve honed our expertise and broadened our scope and abilities. The ever-growing pool of shortlists caters to all facets of life in the digital age: from <font color=\"#1789d5\" face=\"inherit\"><span xss=removed><b>online dating</b></span></font> and <font color=\"#1789d5\" face=\"inherit\"><span xss=removed><b>website building platforms</b></span></font> to <font color=\"#1789d5\" face=\"inherit\"><span xss=removed><b>mortgage providers</b></span></font> and <font color=\"#1789d5\" face=\"inherit\"><span xss=removed><b>VPN services</b></span></font> - and many, many more in between.</p><section class=\"shortlist \" xss=removed><h2 class=\"shortlist__title\" data-toc-anchor=\"1\" xss=removed>How do we create <span class=\"alt\" xss=removed>shortlists</span>?</h2>Once we have an idea for a new Top10 list, our product, content, data, tech and marketing departments knuckle down to bring it together.<blockquote xss=removed>With a decade of experience in comparison, our teams scour every corner of the web, research the options, and distill the information to create tools for confident decision making.</blockquote>Our data scientists dive into big data sets to analyze trends and bring insights that get passed on to our product department, so we can filter the lists for each and every individual user.</section></p><h2 class=\"enhanced__title\" data-toc-anchor=\"2\" xss=removed>Enhanced toolkits for <span class=\"alt\" xss=removed>informed</span> purchasing decisions</h2><section class=\"shortlist \" xss=removed><p xss=removed>Shortlists are the nucleus of decision making, but for deep divers there’s more in store: product reviews and feature comparisons, guides and articles, how to’s and tools, video reviews and tutorials.</p><p xss=removed><br></p><p xss=removed><br></p><p xss=removed><br></p><h2 class=\"people-for-people__title\" data-toc-anchor=\"3\" xss=removed><span class=\"alt\" xss=removed>People</span> working for <span class=\"alt\" xss=removed>people</span></h2><p xss=removed>Our buzzing offices are filled with passionate, driven, skillful experts in their fields - thanks to years of experience in this business and a constant striving for growth and success. We work our magic together to deliver effective shortlists for people.</p></section>',0,'15957069405.jpg','2020-03-23 12:18:54','2020-07-26 01:25:40'),
	(2,'Terms & Condition','terms-condition','<p xss=removed>PLEASE READ THE FOLLOWING CAREFULLY BEFORE ACCESSING AND/OR USING ANY PART OF THE SITE.</p><p xss=removed>Welcome to <a href=\"https://www.top10.com/\">www.top10.com</a> (together with its subdomains, Content and Marks, the “Site”).Please read the following Terms of Use carefully before using this Site so that you are aware of your legal rights and obligations with respect to Natural Intelligence Ltd.(\'NI\', \'we\', \'our\' or \'us\'). By accessing or using the Site, you expressly acknowledge and agree that you are entering a binding legal agreement with us and have understood and agree to comply with, and be legally bound by, these Terms of Use, together with the Privacy Policy that can be accessed by clicking here <a href=\"https://www.naturalint-top10.com/privacy-policy\">https://www.naturalint-top10.com/privacy-policy</a> (the \'Terms\'). You hereby waive any applicable rights to require an original (non-electronic) signature or delivery or retention of non-electronic records, to the extent not prohibited under applicable law. If you do not agree to be bound by these Terms please do not access or use the Site.</p><h2 data-toc-anchor=\"1\" xss=removed>1. Modification.</h2><p xss=removed>We reserve the right, at our discretion, to change these Terms at any time. Such change will be effective ten (10) days following posting of the revised Terms on the Site, and your continued use of the Site thereafter means that you accept those changes.</p><h2 data-toc-anchor=\"2\" xss=removed>2. Ability to Accept Terms.</h2><p xss=removed>The Site is only intended for individuals aged sixteen (16) years or older. If you are under 16 years please do not visit or use the Site.</p><h2 data-toc-anchor=\"3\" xss=removed>3. Site Access.</h2><p xss=removed>During the period in which these Terms are in effect, we hereby grant you permission to visit and use the Site, provided that you comply with these Terms and applicable law.</p><h2 data-toc-anchor=\"4\" xss=removed>4. Restrictions.</h2><p xss=removed>You shall not: (i) copy, distribute display, mirror, frame or modify any part of the Site, Content or Marks (as described below) without our prior written authorization; (ii) use, modify, create derivative works of, transfer (by sale, resale, license, sublicense, download or otherwise), reproduce, distribute, display or disclose Content (defined below), except as expressly authorized herein; (iii) disrupt servers or networks connected to the Site; (iv) use or launch any automated system &#40;including without limitation, \"robots\" and \"spiders\"&#41; to access the Site; and/or (v) circumvent, disable or otherwise interfere with security-related features of the Site or features that prevent or restrict use or copying of any Content or that enforce limitations on use of the Site.</p><h2 data-toc-anchor=\"5\" xss=removed>5. Intellectual Property Rights.</h2><h3 xss=removed>5.1. Content and Marks.</h3><p xss=removed>The (i) content on the Site, including without limitation, the text, documents, articles, brochures, descriptions, products, software, graphics, photos, sounds, videos user interfaces, visual interfaces, photographs, trademarks, logos, sounds, music, artwork, computer code, interactive features, and services (collectively, the \"Materials\") including but not limited to the design, structure, selection, coordination, expression, “look and feel” and arrangement of such Materials; (ii) and User Submissions, as defined below (together with the Materials, the \"Content\"); and (iii) the trademarks, service marks and logos contained therein (\"Marks\"), are owned, controlled or licensed by or to NI and are protected by applicable copyright or other intellectual property laws and treaties. The Site, the Site logo, and other marks are Marks of NI or its affiliates. All other trademarks, service marks, and logos used on the Site are the trademarks, service marks, or logos of their respective owners. We reserve all rights not expressly granted in and to the Site and the Content.</p><p xss=removed>5.2. Use of Content. Content on the Site is provided to you for your information and personal use only and may not be used, modified, copied, distributed, transmitted, broadcast, displayed, sold, licensed, de-compiled, reverse engineered, or otherwise exploited for any other purposes whatsoever(including, without limitation, to create derivative works) without our prior written consent. If you download or print a copy of the Content you must retain all copyright and other proprietary notices contained therein.</p><h2 data-toc-anchor=\"6\" xss=removed>6. Third-Party Sources and Content.</h2><h3 xss=removed>6.1. The Site enables you to view, access, link to, and use content from Third Party Sources (defined below) that are not owned or controlled by us (\'Third Party Content\').</h3><p xss=removed>The Site may also enable you to communicate and interact with Third Party Sources.\'Third Party Source(s)\' means: (i) third party websites and services; and (ii) our partners and customers.</p><h3 xss=removed>6.2. We have no control over any Third Party Sources.</h3><p xss=removed>We do not assume any responsibility for the content, terms of use, privacy policies, actions or practices of, any Third Party Sources. Please read the terms of use and privacy policy of any Third Party Source that you interact with before you engage in any such activity.</p><h3 xss=removed>6.3. We are not responsible for, and we expressly disclaim all warranties regarding, the accuracy, appropriateness, usefulness, safety, or Intellectual Property Rights (defined below) of, or relating to, any Third Party Content.</h3><h3 xss=removed>6.4. By using the Site you may be exposed to Third Party Content that is inaccurate, offensive, indecent, or objectionable.</h3><p xss=removed>You always have the choice of deciding whether or not to interact with a Third Party Source or to view and use Third Party Content. Your interaction with a Third Party Source and your use of, and reliance upon, any Third Party Content is at your sole discretion and risk.</p><h3 xss=removed>6.5. You are solely responsible and liable for your interaction with a Third Party Source.</h3><p xss=removed>You agree to waive, and hereby do waive, any legal or equitable rights or remedies you may have against NI, and release NI from any and all liability, arising from your use of and interaction on any Third Party Content and from your interaction with any Third Party Source. If you have any queries or complaints regarding a Third Party Source or any Third Party Content, you agree to contact the Third Party Source directly.</p><h2 data-toc-anchor=\"7\" xss=removed>7. User Submissions.</h2><h3 xss=removed>7.1. Responsibility.</h3><p xss=removed>The Site may permit the submission, hosting, sharing and publishing of Content by you and other users (\'User Submissions\'). You understand that whether or not such User Submissions are published, we do not guarantee any confidentiality with respect to any User Submissions. You shall be solely responsible for your User Submissions and the consequences of posting, publishing or uploading them. We have complete discretion whether to publish your User Submissions and we reserve the right in our sole discretion and without further notice to you, to monitor, censor, edit, remove, delete, and/or remove any and all Content posted on the Site (including User Submissions) at any time and for any reason.</p><h3 xss=removed>7.2. Ownership.</h3><p xss=removed>You represent and warrant that you own or have the necessary rights and permissions to use and authorize the Site to use all Intellectual Property Rights (defined below) in and to your User Submissions and to enable inclusion and use thereof as contemplated by the Site and these Terms. Unless the User Submissions are separately referred to, all references herein to Content shall include references to User Submissions. \"Intellectual Property Rights\" means any and all rights, titles, and interests, whether foreign or domestic, in and to any and all trade secrets, patents, copyrights, service marks, trademarks, know-how, or similar intellectual property rights, as well as any and all moral rights, rights of privacy, publicity and similar rights of any type under the laws or regulations of any governmental, regulatory, or judicial authority, foreign or domestic. You retain all of your ownership rights in and to your User Submissions.</p><h3 xss=removed>7.3. License to User Submissions.</h3><p xss=removed>By submitting the User Submissions to NI, you hereby grant NI a worldwide, irrevocable, non-exclusive, royalty-free, perpetual, sub-licensable and transferable license to use, reproduce, distribute, prepare derivative works of display, and perform the User Submissions in connection with the Site and NI business, including without limitation for redistributing part or all of your User Submissions (and derivative works thereof)in any media formats and through any media channels and, and you hereby waive any moral rights in your User Submissions, to the extent permitted by law. You also hereby grant each user of the Site or other viewer or user of the User Submission a non-exclusive right to use, reproduce, distribute, prepare derivative works of, display and perform such User Submissions, all in accordance with these Terms.</p><h3 xss=removed>7.4. Prohibited Content.</h3><p xss=removed>You agree that you will not display, post, submit, publish, upload or transmit a User Submission that: (i) is unfair or deceptive under the consumer protection laws of any jurisdiction; (ii) is copyrighted, protected by trade secret or otherwise subject to third party proprietary rights, including privacy and publicity rights, unless you are the owner of such rights; (iii) creates a risk to a person’s safety or health, creates a risk to public safety or health, compromises national security